INSERT INTO `movies` VALUES (263531,'Мстители','The Avengers',2012,'США','02:17:00','Локи, сводный брат Тора, возвращается, и в этот раз он не один. Земля оказывается на грани порабощения, и только лучшие из лучших могут спасти человечество. Глава международной организации Щ.И.Т. Ник Фьюри собирает выдающихся поборников справедливости и добра, чтобы отразить атаку. Под предводительством Капитана Америки Железный Человек, Тор, Невероятный Халк, Соколиный Глаз и Чёрная Вдова вступают в войну с захватчиком.',263531),(263533,'L\'ultimo concerto','',1996,'Италия','00:00:00','None',263533),(263534,'Наши друзья человеки','Nos amis les Terriens',2006,'Франция','01:25:00','None',263534),(263535,'La gare dans le musée 1979-1987','',1987,'Франция','00:18:00','None',263535),(263536,'913','913',2004,'Испания','00:17:00','None',263536),(263537,'Unusual Occupations','',1942,'США','00:11:00','None',263537),(263538,'How to Break 90 #4: Downswing','',1933,'США','00:09:00','None',263538),(263539,'Жан де Лафонтен – вызов судьбе','Jean de La Fontaine - Le défi',2007,'Франция','01:40:00','В фильме мы встречаемся с писателем Лафонтеном в период его парижской жизни, который очень скоро станет переломным в его творчестве. Далеко в провинции живут его жена и дети, о которых восходящая литературная звезда вспоминает крайне редко. Он занят судьбой своего покровителя Фуке, которого арестовали. Жан ищет участия у своих ближайших друзей, но помощь неожиданно приходит к нему в лице герцогини Бульонской. Под ее влиянием Лафонтен начал писать то, что станет его настоящим призванием - басни...',263539),(263540,'Before...','',2003,'Франция','00:08:00','None',263540),(263541,'Grand brun aux yeux doux','',1994,'Франция','00:11:00','None',263541),(263542,'The Castanet Club','',1991,'Австралия','01:25:00','None',263542),(263543,'A Ticket Too Far','',2006,'Великобритания','00:00:00','None',263543),(263545,'The Pace That Thrills','',1952,'США','01:03:00','None',263545),(263546,'Рыжий пес','Red Dog',2011,'Австралия','01:32:00','В далеком шахтерском поселке, где живут суровые и не слишком общительные люди, однажды появляется энергичный рыжий пес из породы келпи. Только ему под силу расшевелить провинциальное сонное царство. Рыжий не подчиняется никому, но его любят все. С помощью неутомимого пса многим поселенцам суждено обрести друзей, счастье, надежду и радость. А некоторым – найти любовь всей своей жизни.',263546),(263547,'Мой Фюрер, или Самая правдивая правда об Адольфе Гитлере','Mein Führer - Die wirklich wahrste Wahrheit über Adolf Hitler',2007,'Германия','01:29:00','Действие комедии разворачивается в 1944 году. Гитлер предстает в ней как физически и психически разрушенный человек, который по совету Геббельса берет в учителя актера-еврея из концлагеря для уроков красноречия, чтобы воодушевить немецкий народ на дальнейшую борьбу. Между делом фюрер играет в ванне игрушечным линкором и пытается научить овчарку Блонди, одетую в форму СС, вскидывать лапу в нацистском приветствии.',263547),(263548,'Пещера желтого пса','Die Höhle des gelben Hundes',2005,'Германия','01:33:00','На сказочный сюжет Бьямбасурен Даваа вдохновили рассказы ее бабушки. Вдали от цивилизации, затерянная в бесконечных ландшафтах Монголии, живет в гармонии с природой семья кочевников, состоящая из пяти человек. По старинной традиции они занимаются овцеводством. Во время одной из прогулок 6-летняя Нансаа в пещере скалы находит маленького пятнистого щенка. Она называет его Зохор и забирает с собой. Отец требует отнести щенка обратно, но Нансаа отказывается разлучаться со своим верным другом. Однажды она теряет собаку в степи. Во время поисков девочка встречает старую кочевницу, которая рассказывает ей таинственную легенду о пещере желтой собаки...',263548),(263549,'Grandpa','',2006,'США','00:14:00','None',263549),(263551,'The Pill','',2006,'США','00:16:00','None',263551),(263552,'Аляска','Alaska',2006,'США','00:17:00','None',263552),(263553,'Kill the Moonlight','',1994,'США','01:16:00','None',263553),(263554,'Гауди','Gaudí',1989,'Испания','00:57:00','None',263554),(263555,'After 8','',2006,'Великобритания','00:18:00','None',263555),(263556,'For No Good Reason','',2004,'США','01:35:00','None',263556),(263557,'Delia\'s Song','',2000,'США','02:00:00','None',263557),(263558,'Hell on Wheels','',1967,'США','01:37:00','None',263558),(263559,'Past Present','',2002,'Канада','00:15:00','None',263559),(263560,'Какой удивительный вечер','Quelle sacrée soirée',1957,'Франция','01:24:00','None',263560),(263561,'Человек и ребёнок','L\'homme et l\'enfant',1956,'Италия','01:30:00','None',263561),(263562,'Этот человек опасен','Cet homme est dangereux',1953,'Франция','01:32:00','Цель Лемми Кошена - спасти Миранду ван Зельтен, дочь бизнесмена, оказавшуюся в руках шайки гангстеров. Их главарь Сигелла намерен получить за Миранду в качестве выкупа от ее отца миллион долларов. Кошен предлагает Сигелле сделку. Однако Сигелла узнает, что Лемми Кошен – агент ФБР и пытается с ним расправиться...',263562),(263563,'Парижские вихри','Tourbillon de Paris',1939,'Франция','01:28:00','None',263563),(263565,'La vie des artistes','',1938,'Франция','00:50:00','None',263565),(263566,'Слезы для тебя','Nada sô sô',2006,'Япония','01:58:00','Эта история о сводных брате и сестре Йотаро и Каору. Йотаро недавно исполнился 21 год, он много работает, чтобы заботиться о своей сестре, которая живёт в маленькой деревушке на острове, и чтобы исполнить мечту - открыть свой ресторан. Забот у него становится вдвое больше когда к нему в Окинаву приезжает сестра, чтобы жить с ним и учиться в хорошей средней школе.',263566),(263567,'Черный пес Санкт-Петербурга','Pietarin musta koira',2000,'Финляндия','00:56:00','None',263567),(263568,'Мечты в ящике','I sogni nel cassetto',1957,'Италия','01:45:00','None',263568),(263569,'Starship II: Rendezvous with Ramses','',2016,'США','01:50:00','None',263569),(263570,'Duncan Removed','',2006,'США','00:21:00','None',263570),(263571,'The Hawk of Powder River','',1948,'США','00:54:00','None',263571),(263578,'Use Your Noodle','',1931,'США','00:20:00','None',263578),(263583,'Освобождение','Liberata',2005,'Франция','01:36:00','None',263583),(263584,'Le syndrome du Carambar','',2005,'Франция','00:11:00','None',263584),(263585,'Picasso','',1985,'Канада','01:23:00','None',263585),(263586,'Margherita','',2005,'Италия','00:10:00','None',263586),(263587,'Windows','',2004,'Италия','00:12:00','None',263587),(263588,'Pugili','',1995,'Италия','01:50:00','None',263588),(263589,'Quando finiranno le zanzare','',1994,'Италия','00:00:00','None',263589),(263590,'Witness to Hope: The Life of Karol Wojtyla, Pope John Paul II','',2002,'США','01:56:00','None',263590),(263591,'Маркиз де Слим','Marquis de Slime',1997,'Франция','00:25:00','None',263591),(263592,'Alain Pacadis, un héros in','',2003,'Франция','00:52:00','None',263592),(263593,'Божественное вмешательство','Divine Intervention',2007,'США','01:40:00','None',263593),(263594,'И пусть все пляшет!','Faut que ça danse!',2007,'Франция','01:40:00','Семья Белински весьма необычна. 80-летний отец Соломон пышет энергией и здоровьем - он не собирается прощаться с жизнью, проводя ее между курсами чечетки под патронажем Фреда Астера и поисками новой спутницы жизни. Давно впавшая в глубокую депрессию мать желает лишь одного: спокойно дожить отведенное ей время под неусыпным и внимательным надзором своего ангела хранителя - месье Мутусами. Их 40-летняя дочь Сара с трудом находит свое место между обожаемыми родителями и живет с Франсуа. Врачи давно поставили ей неутешительный диагноз бесплодия, но она неожиданно беременеет…',263594),(263595,'Le jour de grâce','',2000,'Франция','00:07:00','None',263595),(263596,'Le panorama','',1987,'Франция','00:24:00','None',263596),(263597,'Темная лошадка','Chhupa Rustam: A Musical Thriller',2001,'Индия','02:14:00','Нирмал - единственный наследник состояния своего отца. Его мачеха вместе с любовником решает прибрать к рукам чайную плантацию своего мужа и устраивает автокатастрофу, в которой отец Нирмала погибает. Плантацией также хочет завладеть и вор Раджа, как две капли воды похожий на Нирмала. Однако законного владельца трудно перехитрить — его не зря прозвали «темной лошадкой».',263597),(263599,'Gehra Raaz','',1996,'Индия','00:00:00','None',263599),(263600,'Ahsaan','',1987,'Индия','02:30:00','None',263600),(263601,'Andhaa Yudh','',1987,'Индия','00:00:00','None',263601),(263602,'Превратности судьбы','Muqaddar Ka Faisla',1987,'Индия','00:00:00','Индуистского священника незаслуженно обвиняют в растрате и изнасиловании. Его не только выгоняют из храма, но и сажают в тюрьму, оставив его семью в нищете. Выйдя на свободу, он ищет свою семью и строит планы мести обидчикам.',263602),(263603,'Арендатор','Kirayadar',1986,'Индия','00:00:00','None',263603),(263604,'Maha Shaktimaan','',1985,'Индия','01:49:00','None',263604),(263605,'Salma','',1985,'Индия','00:00:00','None',263605),(263606,'Мой голос','Aaj Ki Awaz',1984,'Индия','02:25:00','История одного человека против системы. Когда его сестра изнасилована и его мать, убитая бригадой головорезов, герой поворачивается к полиции для помощи, но подведен коррумпированными чиновниками. Наконец, он устраивает самосуд.',263606),(263607,'Aasra Pyaar Da','',1983,'Индия','00:00:00','None',263607),(263608,'Хрупкие отношения','Rishta Kagaz Ka',1983,'Индия','02:30:00','Когда родители Суман  погибли, друг их семьи - профессор Шарма, удочеряет её. Жена профессора умирает и Суман берёт на себя ответственность заботиться об отце и двух его сыновьях - Банти и Аруне. Суман влюблена в Рави  и они хотят пожениться. С одобрения мамы Рави и профессора Шарма, назначают дату свадьбы. В тот же день, в результате несчастного случая, брат Банти погибает и свадьба отменяется. Рави едет в США для научно-исследовательских работ, а возвратившись надеется жениться. Но мать Рави не такого счастья хочет для сына, и как только предоставляется возможность просит Суман оставить Рави и больше никогда не появляться в его жизни... Прошли годы. Арун  вырос, выучился на инженера, получил хорошую работу. Он встречается, влюбляется и женится на богатой девушке Арти. Но постепенно их отношения портятся, так как Арти не нравится вмешательство Суман в их отношения с Аруном..',263608),(263609,'Увлажненные веки','Bheegi Palkein',1982,'Индия','02:22:00','None',263609),(263610,'Dulha Bikta Hai','',1982,'Индия','02:18:00','None',263610),(263611,'Raaz','',1981,'Индия','00:00:00','None',263611),(263613,'Bhola in Bollywood','',2004,'Индия','00:00:00','None',263613),(263614,'A Memoir to My Former Self','',2004,'США','00:15:00','None',263614),(263615,'Hum Deewane Pyar Ke','',2001,'Индия','00:00:00','None',263615),(263616,'Неудачник №1','Anari No. 1',1999,'Индия','02:48:00','Раджа скромный официант в пятизвёздочном отеле. Однажды он обслуживает и заботится о богатом бизнесмене К.К., который одалживает ему костюм и некоторую сумму денег, чтобы тот мог найти и обольстить богатую женщину, жениться на ней и разбогатеть. Раджа считает Сапну богатой и успешно добивается её любви, завоевав её сердце. Он не знает, что та простая горничная и также находится в поисках богатого принца. Сапна думает, что Раджа богатый, жизнерадостный и завидный жених Рахул Саксена.В дальнейшем, когда выясняется правда, с помощью друга Раджи, автомобильного вора Саттар-бхая, все трое придумывают заговор с целью похищения Рахула, они удерживают его с целью получения выкупа, в то время как Раджа занимает его место. После похищения Рахула, Раджа занимает его место в семье Рахула, его мачехи Шарды, отца Дханраджа, дяди, тёти, и возлюбленной Соны. Сона оказывается дочерью «наставника» Раджи К.К., что вызывает гнев последнего, когда тот думает, что Раджа ухаживает за его дочерью. Череда похищений держит зрителя в напряжении.',263616),(263617,'Брахма','Brahma',1994,'Индия','00:00:00','None',263617),(263618,'Chor Aur Chand','',1993,'Индия','02:17:00','None',263618),(263619,'Жизнь прекрасна','Jaan Se Pyaara',1992,'Индия','03:00:00','Полицейский инспектор Джей живет жизнью среднего класса со своей матерью и физически и мысленно слабым братом Сандером. Однажды он арестовывает человека по имени Пандей, и после его опроса, узнает, что человек стоящий за расследуемого преступления некто по имени Гуман Сингх. Он выходит на след этого Гумана Сингха и арестовывает его. Тогда начинаются ряд взрывов, которые создают опустошения в городе, инициированные разбойниками, требующими безоговорочного освобождения Гумана. С помощью полиции, не имеющей подсказки относительно местонахождения разбойников или куда они собираются ударить затем, они выпускают Гумана на волю. Потом начинают угрожать Джея страшными последствиями, вынуждая его уйти с его работы. Надеясь, что он и его семья уже в безопасности, Джей начинает восстанавливать свою жизнь рядом с своей возлюбленной Шармилой. Но на зтот раз его поражает личная трагедия - в результате несчастного случая убита его мать, а его брат похищен Джагтапом Сингхом и Гуманом, которые требуют, чтобы он возвратил им сумку, содержащую их ценности. Джей желает сделать что-нибудь, чтобы освободить своего брата, но как может провести переговоры, если у него даже нет зтой самой сумки?',263619),(263620,'Гаджаб Тамааса','Ghazab Tamasha',1992,'Индия','00:00:00','None',263620),(263621,'Mera Dil Tere Liye','',1992,'Индия','00:00:00','None',263621),(263622,'Bandh Darwaza','',1990,'Индия','02:35:00','None',263622),(263623,'Отдаю тебе сердце','Dil Tujhko Diya',1987,'Индия','00:00:00','Отсидев много лет в тюрьме по сфабрикованному обвинению, мать находит двух своих сыновей и рассказывает им о том, что она абсолютно невиновна. Их отца убил их родственник, стремящийся завладеть богатством семьи. Два брата объединяют свои усилия, чтобы восстановить справедливость и наказать истинного виновника...',263623),(263626,'Ucha Dar Babe Nanak Da','',1982,'Индия','02:35:00','None',263626),(263627,'Gamdani Gori','',1981,'Индия','00:00:00','None',263627),(263628,'Kaaran','',1981,'Индия','00:00:00','None',263628),(263630,'Lambhardarni','',