с молодым коллегой мужа, который меняет всю ее жизнь - Сара без памяти влюбляется в него и готова разрушить свой брак.Однако в один прекрасный день молодого человека арестовывают и отправляют на остров. Обезумев от горя, Сара отказывается от высокого положения в обществе, богатства и благополучия и жертвует всем ради любви. Их долгожданная встреча происходит на острове, куда она попадает по приговору суда... ',263709),(263710,'Esta no es la vida privada de Javier Krahe','',2005,'Испания','01:25:00','None',263710),(263711,'Волшебная Русь','',2004,'Израиль','01:36:00','None',263711),(263712,'Celestial Navigation','',1993,'США','00:24:00','None',263712),(263713,'Новеченто: пианист','Novecento: pianiste',2005,'Франция','00:17:00','Кажется вся печаль мира заключена в этой истории - о корабельном найденыше, который вырос в гениального пианиста, его звали по году рождения — Тысяча Девятисотый — и всю свою жизнь, включая две мировых войны, он провел в океане, и даже любовь не заставила его сойти с корабля на сушу...',263713),(263715,'Американский первоцвет','American Cowslip',2009,'США','01:48:00','В небольшом городке в Калифорнийской пустыне живет наркоман Этан Инглебринк, который одержим своим садом. Он пытается вырастить редкий цветок - «американский первоцвет», но у него нет денег чтоб заплатить за аренду земли и надо еще найти денег на наркотики. Тогда он решается сыграть в покер с призовым фондом 10 000 и как всегда дело не обходится без женщины и опасностей...',263715),(263716,'De Lama Lamina','',2007,'США','00:56:00','None',263716),(263719,'Ella','',2005,'Испания','00:18:00','None',263719),(263720,'Arrivederci Millwall','',1990,'Великобритания','00:00:00','None',263720),(263721,'След юга','La piste du sud',1938,'Франция','00:00:00','None',263721),(263722,'Воображаемые бродяги','Vagabonds imaginaires',1950,'Франция','01:02:00','None',263722),(263723,'С Андре Жидом','Avec André Gide',1952,'Франция','01:25:00','None',263723),(263724,'Государство – это я','Mir reicht\'s - ich steig aus',1983,'Германия (ФРГ)','01:31:00','None',263724),(263725,'Syd Barrett\'s First Trip','',1966,'Великобритания','00:11:00','None',263725),(263726,'Az orvos titka','',1930,'США','01:17:00','None',263726),(263729,'Восхитительный Крайтон','The Admirable Crichton',1918,'Великобритания','00:00:00','None',263729),(263730,'The Man of Her Choice','',1914,'США','00:10:00','None',263730),(263732,'Skinheads','',2006,'Канада','00:16:00','None',263732),(263733,'Continuavano a chiamarli... er più e er meno','',1972,'Италия','01:37:00','Однажды в жизни мошенника и вора Франко Пьетрасикка наступил день, которого он с ужасом ждал несколько лет: его выгнали из уютной и обжитой тюремной камеры в кошмарный внешний мир. В это же время герцог Франческо Рибанера Мендоса д’Эспиноса проигрывал в карты свое состояние, дворец и все такое прочее, оставаясь должен астрономическую сумму. Естественно, двум неудачникам суждено было встретиться, когда нищий воришка попытался ограбить разорившегося аристократа. И тут две родственные души нашли друг друга, составив комплот, который должен будет помочь герцогу вернуть свое положение в обществе, а Франко обрести столь вожделенное им богатство…',263733),(263734,'Сеть','The Plex',2008,'Австралия','01:35:00','None',263734),(263735,'Десять историй о любви','Dus Kahaniyaan',2007,'Индия','01:54:00','Фильм состоит из 10 историй никак между собой не связанных. У каждой истории - свои герои, свой жанр, свой стиль повествования.1. «Тарелка риса / Rice Plate».   Как быть голодной женщине, если руку помощи и еду ей протягивает мужчина иного вероисповедания?   2. «Секс на пляже / Sex on the Beach».  Хорошо лежать на пляже, читать книгу, а затем наяву увидать обольстительную героиню романа в мини-бикини...   3. «Долина любви / Lovedale».  Случайная встреча в поезде с пожилой женщиной практически полностью перевернула жизнь юной девушке...4. «Супружество / Matrimony».  Изнывая от скуки, жена бизнесмена находит себе любовника.5. «Шарики / Gubbare».   Поссорившись в автобусе со своим мужем, Анита подсаживается к мужчине, который держит в руках 14 красных шариков.   6. «Женская судьба / Pooranmashi».   Единственная дочь матери собирается выйти замуж.   7. «Ночной незнакомец / Strangers in the Night».  Каждый раз, отмечая свои дни рождения, муж с женой делятся секретами.   8. «Поворот на шоссе / High on the Highway».  На шоссе иногда происходят самые невероятные истории.   9. «Тайна / Zahir».   Писатель от любви сходит с ума.  10. «Дружба и предательство / Rise and Fall».  Два гангстера дружат с детства, но, сколько веревочке не виться...',263735),(263736,'Мистер Мошенник','Mr. Fraud',2012,'Индия','00:00:00','None',263736),(263737,'Второй я','Jaane Hoga Kya',2006,'Индия','02:35:00','Молодой талантливый ученый Сидхартх Сардесаи работает над созданием человеческого клона. Два года он безуспешно пытался создать клон человека, он даже потерял коллегу и друга во время этих опытов. Но он уверен в своем успехе и теперь ему нужно разрешение на продолжение работы от его наставника, доктора Кришнана, который отказывает в этом Сидхартху. В отчаянии молодой ученый готов на все, чтобы продолжить опыты. Его инвестором мог бы стать отец его невесты Адити, бизнесмен, господин Чопра. Сидхартх соглашается с предложением Адити взять деньги у ее отца, строит свою лабораторию на заброшенном заводе и начинает эксперименты. Его первым подопытным объектом становится крыса. Эксперимент проходит удачно и ученый клонирует самого себя! Клон, появившись на свет, сразу сбегает, а Сидхартха внезапно бросают за решетку по обвинению в нападении на девушку. Ученый знает, что это сделал его двойник, но никто не верит его рассказам.',263737),(263738,'Horses Never Lie','',2003,'Канада','00:06:00','None',263738),(263740,'Надин','Nadine',2007,'Бельгия','01:40:00','None',263740),(263741,'On the Brink','',2006,'США','00:12:00','None',263741),(263742,'Lo scugnizzo','',1979,'Италия','01:45:00','None',263742),(263743,'Эй, друг... покойся с миром!','Ehi amigo... sei morto!',1970,'Италия','01:27:00','Барнет со своей шайкой из восьми человек нападает на прибывший в небольшой техасский городок почтовый экипаж и похищает сто тысяч долларов. После налёта бандиты пытаются укрыться в заброшенной шахте, но Дон Уильямс, сопровождавший ограбленный экипаж, выходит на их след.',263743),(263744,'Короли Франции','I Reali di Francia',1959,'Италия','01:28:00','Роланд, граф Безансонский, должен обеспечивать личную безопасность французского короля Людовика VII во время затеянного тем паломничества в Испанию. Оказавшись на Пиренеях, французский граф оказывается в центре интриг, ведущихся вокруг эмира мавров. Главный визирь того решил взять власть в свои руки и устранить своего повелителя. Но на его пути остается еще дочь эмира Сулейма, которая, к тому же, успела влюбиться в красавца-гяура. И когда хищные руки предателя потянулись к девушке, благородный Роланд не мог отказать ей в помощи. А тем временем, поезд французского короля все ближе и ближе приближался к границам Испании…',263744),(263746,'Ирина Палм сделает ЭТО лучше','Irina Palm',2007,'Бельгия','01:43:00','Пятидесятилетняя Мэгги должна раздобыть крупную сумму для лечения умирающего внука. Она едет из своего пригорода в лондонский злачный квартал Сохо и тайком нанимается в ночной клуб, сексуальной работницей. Ее функции сопоставимы с мытьем писсуаров, но носят более интимный характер: она сидит в закутке с дыркой в стене и утоляет естественную потребность невидимых клиентов простейшим, но тоже требующим мастерства способом. А так как женщина она артистичная, чуткая и умелая, то и искусство ее быстро растет, к новоявленной звезде под «сценическим псевдонимом» Ирина Палм тянется очередь, клуб пользуется успехом.',263746),(263747,'Ленц','Lenz',2006,'Германия','01:36:00','None',263747),(263748,'The Northern Kingdom','',2009,'США','01:48:00','None',263748),(263749,'Favorite Son','',2008,'США','01:30:00','None',263749),(263750,'Vampirisme','',1967,'Франция','00:12:00','None',263750),(26375