 готовились стать математиками, физиками и служить своей Родине.Потом наступила перестройка. Одной из учеников этого класса была автор и режиссер фильма Екатерина Еременко. В фильме «Мой класс», история жизни одноклассников, рассказанная через субъективный авторский взгляд, показана параллельно чтению курса физики, демонстрируемом в 12 физических экспериментах, которые однажды изучали в этой школе.',264023),(264024,'Солдатский сон','',1995,'Россия','00:12:00','None',264024),(264025,'Элегия из России','',1993,'Россия','01:08:00','None',264025),(264026,'High Tomb','',1995,'США','01:26:00','None',264026),(264027,'Санинспектор. Видеопортрет Уильяма С. Берроуза','William S. Burroughs: Commissioner of Sewers',1991,'Германия','01:00:00','Документальный фильм о культовом американском писателе Уильяме С. Берроузе. В фильме Берроуз рассказывает о своей эстетике нарезок (cut-up), восходящей к дадаистским коллажам, отношении к живописи, кинематографу и т.д.; демонстрируются видеозаписи Берроуза, фрагменты из художественных фильмов с его участием. Сегодня очевидна уникальность его творчества, не вписывающегося только лишь в психоделическую литературу 60-х или в постмодернистскую практику сверхсгибания, как определил творчество писателя французский философ Жиль Делез.',264027),(264028,'Fried Shoes Cooked Diamonds','',1979,'США','00:55:00','None',264028),(264029,'Билл и Тони','Bill and Tony',1972,'Великобритания','00:00:00','None',264029),(264030,'Cain\'s Film','',1969,'Великобритания','00:27:00','None',264030);
