длен Марион','Madeleine Marion',131971,'None',NULL,'ACTOR'),(132364,'Мишель Лемуан','Michel Lemoine',132364,'Marquis de Slime',NULL,'ACTOR'),(132500,'Рональд Э. Хаус','Ronald E. House',132500,'Tony Langdon / Uncle Julian',NULL,'ACTOR'),(132972,'Эна Бегович','Ena Begovic',132972,'Danka','В начале 1990-х годов Эна, управлявшая автомобилем в городе Загреб (Хорватия), попала в тяжёлую автокатастрофу, повлёкшую за собой смерть одного из пассажиров. Она сама чудом выжила. Почти 10 лет спустя, 15 августа 2000 года в городе Брач (Хорватия), Бегович вновь попала в автокатастрофу. На этот раз чуда не произошло — 40-летняя актриса, новоиспечённая жена и мать полуторамесячной дочери Ланы скончалась от тяжёлой травмы головы. Женщина была похоронена на кладбище «Мирогой» в городе Загреб, городе где она впервые попала в автокатастрофу. После гибели женщины её вдовец, Иосиф Радельяк, жил в фактическом браке с актрисой Долорес Ламбаша (англ.)русск. (1981—2013), которая вырастила их дочь Лану. 13 лет спустя после гибели Бегович, 23 октября 2013 года, 32-летняя Ламбаша также погибла в автокатастрофе.','ACTOR'),(134060,'Эдриэнн Сакс','Adrianne Sachs',134060,'Shopper #1',NULL,'ACTOR'),(134087,'Номса Нене','Nomsa Nene',134087,'Domestic worker',NULL,'ACTOR'),(134218,'Лаура Бетти','Laura Betti',134218,'None','Настоящее имя - Лаура Тромбетти (Laura Trombetti).','ACTOR'),(134286,'Пэдди Джойс','Paddy Joyce',134286,'Jack Bates',NULL,'ACTOR'),(134404,'Арто Линдсей','Arto Lindsay',134404,'None',NULL,'COMPOSER'),(134869,'Клод Агостини','Claude Agostini',134869,'None',NULL,'OPERATOR'),(135071,'Николь Эванс','Nicole Evans',135071,'играет саму себя',NULL,'ACTOR'),(135386,'Саймон Брук','Simon Brook',135386,'None',NULL,'DIRECTOR'),(136325,'Карлос Кардан','Carlos Cardán',136325,'Miguel',NULL,'ACTOR'),(136475,'Элеонора Росси Драго','Eleonora Rossi Drago',136475,'Monica',NULL,'ACTOR'),(137230,'Лейф Андре','Leif Andrée',137230,'Step father',NULL,'ACTOR'),(138248,'Луис Барбо','Luis Barboo',138248,'None',NU